INSERT INTO `commercials` (`id`, `title`, `image`, `details`, `created_at`, `updated_at`) VALUES
(2, 'my first commercial work', '1703939940.commercial.jpg', '<p class=\"p p-first\" style=\"box-sizing: inherit; line-height: inherit; margin: 20pt 0px; hyphens: none; font-family: Cambria, &quot;Cambria Math&quot;, stixgeneral, &quot;Times New Roman&quot;, Times, serif; font-size: 20px;\"><font color=\"#000000\">The Rohingya refugee crisis is neither new nor a sudden problem for Bangladesh. After the introduction of the Emergency Immigration Act by the military regime of Myanmar in 1978, the minority Muslim Rohingyas started flocking to Bangladesh. The total number of Rohingya refugees in Bangladesh is debatable. The United Nations Refugee Agency (UNHCR) reported that in 2011, around 265,000 Rohingya Refugees were residing, out of which 29,000 were recognized, 36,000 were unrecognized, and 200,000 were undocumented by the Government of Bangladesh (GoB) and other non-governmental organizations (NGOs) [<a href=\"https://www.ncbi.nlm.nih.gov/pmc/articles/PMC7489778/#REF1\" rid=\"REF1\" class=\" bibr popnode\" role=\"button\" aria-expanded=\"false\" aria-haspopup=\"true\" style=\"box-sizing: inherit; text-decoration-line: underline;\">1</a>].</font></p><p style=\"box-sizing: inherit; line-height: inherit; margin: 20pt 0px; hyphens: none; font-family: Cambria, &quot;Cambria Math&quot;, stixgeneral, &quot;Times New Roman&quot;, Times, serif; font-size: 20px;\"><font color=\"#000000\">However, the recent violence in August 2017 instigated the migration of 6,93,000 additional Rohingyas, increasing the number, as of June 2018, to around 1 million (918,936) in Bangladesh [<a href=\"https://www.ncbi.nlm.nih.gov/pmc/articles/PMC7489778/#REF2\" rid=\"REF2\" class=\" bibr popnode\" role=\"button\" aria-expanded=\"false\" aria-haspopup=\"true\" style=\"box-sizing: inherit; text-decoration-line: underline;\">2</a>]. Refugees from the recent exodus found a place in large camps or settlements, and their total number is 904,056. Among these camps, the Kutupalong Expansion Site (an extension made near the original Kutupalong Refugee Camp) houses the majority of the refugees (610,251), followed by Hakimpara-Jamtoli-Bagghona Camp (98,529), and Nayapara Camp (71,562). The rest of the refugees are housed among the host communities of Cox’s Bazar Sadar, Ramu, Teknaf, and Ukhia (120,044).</font></p><p style=\"box-sizing: inherit; line-height: inherit; margin: 20pt 0px; hyphens: none; font-family: Cambria, &quot;Cambria Math&quot;, stixgeneral, &quot;Times New Roman&quot;, Times, serif; font-size: 20px;\"><font color=\"#000000\">The recent exodus of August 2017</font></p><p style=\"box-sizing: inherit; line-height: inherit; margin: 20pt 0px; hyphens: none; font-family: Cambria, &quot;Cambria Math&quot;, stixgeneral, &quot;Times New Roman&quot;, Times, serif; font-size: 20px;\"><font color=\"#000000\">Rohingyas live in the Rakhine state of Myanmar, adjacent to the Bangladesh border. The 1982 Citizenship Act of Myanmar created three unequal tiers in the citizenship of Myanmar, namely, Full Citizens (pink card), Associate Citizens (blue card), and Naturalized Citizens (green card), and thus disenfranchised several ethnic groups, including the Rohingyas [<a href=\"https://www.ncbi.nlm.nih.gov/pmc/articles/PMC7489778/#REF3\" rid=\"REF3\" class=\" bibr popnode\" role=\"button\" aria-expanded=\"false\" aria-haspopup=\"true\" style=\"box-sizing: inherit; text-decoration-line: underline;\">3</a>]. As a result of alleged persecutions followed by the enaction of the law, a large number of Rohingyas eventually fled illegally to not only Bangladesh but also to countries such as Saudi Arabia, Pakistan, Thailand, and Malaysia [<a href=\"https://www.ncbi.nlm.nih.gov/pmc/articles/PMC7489778/#REF4\" rid=\"REF4\" class=\" bibr popnode\" role=\"button\" aria-expanded=\"false\" aria-haspopup=\"true\" style=\"box-sizing: inherit; text-decoration-line: underline;\">4</a>]. Aung San Suu Kyi took up the role of the State Counselor of Myanmar in 2016. In Rakhine State, she restarted the citizenship verification process, which faced resistance from the Rohingya community [<a href=\"https://www.ncbi.nlm.nih.gov/pmc/articles/PMC7489778/#REF5\" rid=\"REF5\" class=\" bibr popnode\" role=\"button\" aria-expanded=\"false\" aria-haspopup=\"true\" style=\"box-sizing: inherit; text-decoration-line: underline;\">5</a>]. The latest exodus of Rohingyas began on August 25, 2017, as the consequence of the Myanmar army\'s and Rakhine Buddhists’ campaign against Rohingya civilians followed by a coordinated attack of Arakan Rohingya Salvation Army (ARSA) on 30 police posts [<a href=\"https://www.ncbi.nlm.nih.gov/pmc/articles/PMC7489778/#REF5\" rid=\"REF5\" class=\" bibr popnode\" role=\"button\" aria-expanded=\"false\" aria-haspopup=\"true\" style=\"box-sizing: inherit; text-decoration-line: underline;\">5</a>-<a href=\"https://www.ncbi.nlm.nih.gov/pmc/articles/PMC7489778/#REF6\" rid=\"REF6\" class=\" bibr popnode\" role=\"button\" aria-expanded=\"false\" aria-haspopup=\"true\" style=\"box-sizing: inherit; text-decoration-line: underline;\">6</a>]. Within two months, from August 2017 to October 2017, hundreds of thousands of Rohingya refugees fled to Bangladesh through the Bangladesh-Myanmar border [<a href=\"https://www.ncbi.nlm.nih.gov/pmc/articles/PMC7489778/#REF2\" rid=\"REF2\" class=\" bibr popnode\" role=\"button\" aria-expanded=\"false\" aria-haspopup=\"true\" style=\"box-sizing: inherit; text-decoration-line: underline;\">2</a>].</font></p><p class=\"p p-last\" style=\"box-sizing: inherit; line-height: inherit; margin: 20pt 0px; hyphens: none; font-family: Cambria, &quot;Cambria Math&quot;, stixgeneral, &quot;Times New Roman&quot;, Times, serif; font-size: 20px;\"><font color=\"#000000\">This massive influx made Rohingya refugees live in settlements where the majority of them did not have access to good housing, safe drinking water, and good sanitation systems, which, in turn, increased their vulnerability to a wide range of infectious diseases [<a href=\"https://www.ncbi.nlm.nih.gov/pmc/articles/PMC7489778/#REF2\" rid=\"REF2\" class=\" bibr popnode\" role=\"button\" aria-expanded=\"false\" aria-haspopup=\"true\" style=\"box-sizing: inherit; text-decoration-line: underline;\">2</a>]. Additionally, Rohingya people are exposed to war-related traumatic events, including the destruction of property, loss of family members, witnessing extreme violence, and injury or loss of property. These events have the potential to make Rohingya refugees suffer from different psychological distress [<a href=\"https://www.ncbi.nlm.nih.gov/pmc/articles/PMC7489778/#REF5\" rid=\"REF5\" class=\" bibr popnode\" role=\"button\" aria-expanded=\"false\" aria-haspopup=\"true\" style=\"box-sizing: inherit; text-decoration-line: underline;\">5</a>]. Against this backdrop, it is important to ensure health service for the Rohingya population, and to do so&nbsp;knowing about their current health status is imperative because without this information, equal and equitable health service provision, as well as appropriate resource allocation, is not possible. Besides, failure to provide adequate health service and thus to maintain the sound health of Rohingya refugees might adversely affect the health status of Bangladeshi people as well. So, we conducted this review to understand the current health status of the Rohingya refugees in Bangladesh. This will help the policymakers determine what evidence needs to be generated and how to better tackle the Rohingya situation in Bangladesh. This will also help international or bilateral agencies to prioritize their efforts for this protracted refugee crisis.</font></p>', '2023-12-30 05:53:41', '2023-12-30 06:39:00'),
(3, 'my first commercial work', '1703940031.commercial.jpg', '<p class=\"p p-first\" style=\"box-sizing: inherit; line-height: inherit; margin: 20pt 0px; hyphens: none; font-family: Cambria, &quot;Cambria Math&quot;, stixgeneral, &quot;Times New Roman&quot;, Times, serif; font-size: 20px;\"><font color=\"#000000\">The Rohingya refugee crisis is neither new nor a sudden problem for Bangladesh. After the introduction of the Emergency Immigration Act by the military regime of Myanmar in 1978, the minority Muslim Rohingyas started flocking to Bangladesh. The total number of Rohingya refugees in Bangladesh is debatable. The United Nations Refugee Agency (UNHCR) reported that in 2011, around 265,000 Rohingya Refugees were residing, out of which 29,000 were recognized, 36,000 were unrecognized, and 200,000 were undocumented by the Government of Bangladesh (GoB) and other non-governmental organizations (NGOs) [<a href=\"https://www.ncbi.nlm.nih.gov/pmc/articles/PMC7489778/#REF1\" rid=\"REF1\" class=\" bibr popnode\" role=\"button\" aria-expanded=\"false\" aria-haspopup=\"true\" style=\"box-sizing: inherit; text-decoration-line: underline;\">1</a>].<br></font></p><table class=\"table table-bordered\"><tbody><tr><td><p><img src=\"data:image/jpeg;base64,\" data-filename=\"images.jpeg\" style=\"width: 100%;\"><br></p></td></tr></tbody></table><p class=\"p p-first\" style=\"box-sizing: inherit; line-height: inherit; margin: 20pt 0px; hyphens: none; font-family: Cambria, &quot;Cambria Math&quot;, stixgeneral, &quot;Times New Roman&quot;, Times, serif; font-size: 20px;\"><font color=\"#000000\"><br></font><font color=\"#000000\"><br></font></p><p style=\"box-sizing: inherit; line-height: inherit; margin: 20pt 0px; hyphens: none; font-family: Cambria, &quot;Cambria Math&quot;, stixgeneral, &quot;Times New Roman&quot;, Times, serif; font-size: 20px;\"><font color=\"#000000\">However, the recent violence in August 2017 instigated the migration of 6,93,000 additional Rohingyas, increasing the number, as of June 2018, to around 1 million (918,936) in Bangladesh [<a href=\"https://www.ncbi.nlm.nih.gov/pmc/articles/PMC7489778/#REF2\" rid=\"REF2\" class=\" bibr popnode\" role=\"button\" aria-expanded=\"false\" aria-haspopup=\"true\" style=\"box-sizing: inherit; text-decoration-line: underline;\">2</a>]. Refugees from the recent exodus found a place in large camps or settlements, and their total number is 904,056. Among these camps, the Kutupalong Expansion Site (an extension made near the original Kutupalong Refugee Camp) houses the majority of the refugees (610,251), followed by Hakimpara-Jamtoli-Bagghona Camp (98,529), and Nayapara Camp (71,562). The rest of the refugees are housed among the host communities of Cox’s Bazar Sadar, Ramu, Teknaf, and Ukhia (120,044).</font></p><p style=\"box-sizing: inherit; line-height: inherit; margin: 20pt 0px; hyphens: none; font-family: Cambria, &quot;Cambria Math&quot;, stixgeneral, &quot;Times New Roman&quot;, Times, serif; font-size: 20px;\"><font color=\"#000000\">The recent exodus of August 2017</font></p><p style=\"box-sizing: inherit; line-height: inherit; margin: 20pt 0px; hyphens: none; font-family: Cambria, &quot;Cambria Math&quot;, stixgeneral, &quot;Times New Roman&quot;, Times, serif; font-size: 20px;\"><font color=\"#000000\">Rohingyas live in the Rakhine state of Myanmar, adjacent to the Bangladesh border. The 1982 Citizenship Act of Myanmar created three unequal tiers in the citizenship of Myanmar, namely, Full Citizens (pink card), Associate Citizens (blue card), and Naturalized Citizens (green card), and thus disenfranchised several ethnic groups, including the Rohingyas [<a href=\"https://www.ncbi.nlm.nih.gov/pmc/articles/PMC7489778/#REF3\" rid=\"REF3\" class=\" bibr popnode\" role=\"button\" aria-expanded=\"false\" aria-haspopup=\"true\" style=\"box-sizing: inherit; text-decoration-line: underline;\">3</a>]. As a result of alleged persecutions followed by the enaction of the law, a large number of Rohingyas eventually fled illegally to not only Bangladesh but also to countries such as Saudi Arabia, Pakistan, Thailand, and Malaysia [<a href=\"https://www.ncbi.nlm.nih.gov/pmc/articles/PMC7489778/#REF4\" rid=\"REF4\" class=\" bibr popnode\" role=\"button\" aria-expanded=\"false\" aria-haspopup=\"true\" style=\"box-sizing: inherit; text-decoration-line: underline;\">4</a>]. Aung San Suu Kyi took up the role of the State Counselor of Myanmar in 2016. In Rakhine State, she restarted the citizenship verification process, which faced resistance from the Rohingya community [<a href=\"https://www.ncbi.nlm.nih.gov/pmc/articles/PMC7489778/#REF5\" rid=\"REF5\" class=\" bibr popnode\" role=\"button\" aria-expanded=\"false\" aria-haspopup=\"true\" style=\"box-sizing: inherit; text-decoration-line: underline;\">5</a>]. The latest exodus of Rohingyas began on August 25, 2017, as the consequence of the Myanmar army\'s and Rakhine Buddhists’ campaign against Rohingya civilians followed by a coordinated attack of Arakan Rohingya Salvation Army (ARSA) on 30 police posts [<a href=\"https://www.ncbi.nlm.nih.gov/pmc/articles/PMC7489778/#REF5\" rid=\"REF5\" class=\" bibr popnode\" role=\"button\" aria-expanded=\"false\" aria-haspopup=\"true\" style=\"box-sizing: inherit; text-decoration-line: underline;\">5</a>-<a href=\"https://www.ncbi.nlm.nih.gov/pmc/articles/PMC7489778/#REF6\" rid=\"REF6\" class=\" bibr popnode\" role=\"button\" aria-expanded=\"false\" aria-haspopup=\"true\" style=\"box-sizing: inherit; text-decoration-line: underline;\">6</a>]. Within two months, from August 2017 to October 2017, hundreds of thousands of Rohingya refugees fled to Bangladesh through the Bangladesh-Myanmar border [<a href=\"https://www.ncbi.nlm.nih.gov/pmc/articles/PMC7489778/#REF2\" rid=\"REF2\" class=\" bibr popnode\" role=\"button\" aria-expanded=\"false\" aria-haspopup=\"true\" style=\"box-sizing: inherit; text-decoration-line: underline;\">2</a>].</font></p><p class=\"p p-last\" style=\"box-sizing: inherit; line-height: inherit; margin: 20pt 0px; hyphens: none; font-family: Cambria, &quot;Cambria Math&quot;, stixgeneral, &quot;Times New Roman&quot;, Times, serif; font-size: 20px;\"><font color=\"#000000\">This massive influx made Rohingya refugees live in settlements where the majority of them did not have access to good housing, safe drinking water, and good sanitation systems, which, in turn, increased their vulnerability to a wide range of infectious diseases [<a href=\"https://www.ncbi.nlm.nih.gov/pmc/articles/PMC7489778/#REF2\" rid=\"REF2\" class=\" bibr popnode\" role=\"button\" aria-expanded=\"false\" aria-haspopup=\"true\" style=\"box-sizing: inherit; text-decoration-line: underline;\">2</a>]. Additionally, Rohingya people are exposed to war-related traumatic events, including the destruction of property, loss of family members, witnessing extreme violence, and injury or loss of property. These events have the potential to make Rohingya refugees suffer from different psychological distress [<a href=\"https://www.ncbi.nlm.nih.gov/pmc/articles/PMC7489778/#REF5\" rid=\"REF5\" class=\" bibr popnode\" role=\"button\" aria-expanded=\"false\" aria-haspopup=\"true\" style=\"box-sizing: inherit; text-decoration-line: underline;\">5</a>]. Against this backdrop, it is important to ensure health service for the Rohingya population, and to do so&nbsp;knowing about their current health status is imperative because without this information, equal and equitable health service provision, as well as appropriate resource allocation, is not possible. Besides, failure to provide adequate health service and thus to maintain the sound health of Rohingya refugees might adversely affect the health status of Bangladeshi people as well. So, we conducted this review to understand the current health status of the Rohingya refugees in Bangladesh. This will help the policymakers determine what evidence needs to be generated and how to better tackle the Rohingya situation in Bangladesh. This will also help international or bilateral agencies to prioritize their efforts for this protracted refugee crisis.</font></p>', '2023-12-30 05:53:41', '2023-12-30 06:41:59');

